import React from "react";
import "./index.css";
import PropTypes from "prop-types";

function Menu({button_titles}) {
    return <header>
            <nav>
                <button className="">{button_titles}</button>
            </nav>
           </header>
}

Menu.propTypes = {
    buttons_title: PropTypes.arrayOf(PropTypes.string).isRequired,
}

export default Menu
